import React from "react"
import "./style.css"

const Nav = () => {
    return (
        <div className= "main-nav">
            <h3 className= "toby-nav"></h3>
            <a href>Home</a>
            <a href>Employees</a>
            <a href>Log Out</a>
        </div>
    )
}

export default Nav;
